import React, { useState } from 'react';

const triviaQuestions = [
  {
    question: 'In what year was Stanford University founded?',
    answer: '1885',
  },
  {
    question: "What is the name of the iconic tower on Stanford's campus?",
    answer: 'Hoover Tower',
  },
  {
    question: 'What is the official color of Stanford University?',
    answer: 'Cardinal',
  },
];

const AcceptanceLetter = () => (
  <div className="min-h-screen bg-[#FAF9F6] flex flex-col items-center justify-center">
    <div className="bg-white shadow-lg rounded-lg p-12 max-w-xl text-center">
      <h1 className="text-3xl font-bold text-[#8C1515] mb-6">Congratulations!</h1>
      <p className="mb-4">We are pleased to inform you that you have been admitted to Stanford University.</p>
      <p className="mb-8">Welcome to the Stanford family! 🎓</p>
      <div className="italic text-gray-600">(This is a mock acceptance letter for password recovery.)</div>
    </div>
  </div>
);

const TriviaRecovery = ({ onSuccess }: { onSuccess: () => void }) => {
  const [step, setStep] = useState(0);
  const [input, setInput] = useState('');
  const [error, setError] = useState('');

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    if (input.trim().toLowerCase() === triviaQuestions[step].answer.toLowerCase()) {
      setInput('');
      setError('');
      if (step === triviaQuestions.length - 1) {
        onSuccess();
      } else {
        setStep(step + 1);
      }
    } else {
      setError('Incorrect! Try again.');
    }
  };

  return (
    <div className="min-h-screen bg-[#FAF9F6] flex flex-col items-center justify-center">
      <div className="bg-white shadow-lg rounded-lg p-10 max-w-lg w-full">
