        <form onSubmit={handleSubmit}>
          <div className="mb-4 text-lg">{triviaQuestions[step].question}</div>
          <input
            className="w-full p-2 border border-gray-300 rounded mb-4"
            value={input}
            onChange={e => setInput(e.target.value)}
